[Web](https://cringecrows.com) & [Twitter](https://twitter.com/cringecrows) & [Discord](https://discord.gg/cringecrows)

Cringe Crows is an NFT flock made in cooperation with the esports team CrowCrowd. Our birds represent the connection between modern society, trends, memes and cryptocurrencies.

Inspired by diverse video games and geek communities, we made them unique and easily recognizable: each crow is one-and-only in its appearance, traits and background. Also, they look way better than other NFT garbage.

Why?

- Cringe number of 4567 birds

- Created by 2 weird guys on a late-night;

- 40 legendary handmade crows inspired by pop-culture and video games, spread randomly throughout numbers (each one is mega-unique);

- First-ever NFT Mascot for the real esports team;

- Because CAW-CAW, that's why;

